import React from 'react';
import ReactDOM from 'react-dom';
import { Router, Switch,Route, Link, browserHistory, IndexRoute } from 'react-router-dom'
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter } from 'react-router-dom'
import Appointment from "./body";
import './sidebar.css';
class SideNavPage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {isToggle: true};
        this.handleClick = this.handleClick.bind(this);
      }

      handleClick(e) {
        this.setState({isToggle: !this.state.isToggle});
      }


  render() {
      return (
        <div className="container" id="j" >
          <div className="row" >

        <div className="col-sm-2" id="lp"> 

        <div  style={{display: this.state.isToggle ? 'block': 'none'}}>  

        <div className="wrapper"> 

          <div className="sidebar" >


            </div>
            </div>
        </div>
        <div ><button className="btn btn-primary" onClick={this.handleClick}>
             <span className="spinner-border spinner-border-sm"></span>
             </button></div>

             </div>

           <div className="col-sm-9">
             <li className="nav-item" style={{left:"0px"}}>
               <div className="container p-3 my-3 border jumbotron"  style={{height:"500px"}} >welcomme!!!!
               </div>
               <div>
               <li><Link to="/body"><i className="fas fa-project-diagram"></i>Appoitment</Link></li>

               <BrowserRouter>
                <Switch>
                <Route path="/body" component = {Appointment} /> 

                </Switch>

                </BrowserRouter>

                </div>
             </li>
             </div>
             </div> 
        </div>
      );
    }
  }

  export default SideNavPage;
